import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { WrapperComponent } from './wrapper/wrapper.component';
import { AccountSetupComponent } from './account-setup/account-setup.component';
import { BusinessSetupComponent } from './business-setup/business-setup.component';
import { PreferencesComponent } from './preferences/preferences.component';
import { ReviewAndSubmitComponent } from './review-and-submit/review-and-submit.component';
import { ActivationComponent } from './activation/activation.component';
import { VerificationPendingComponent } from './verification-pending/verification-pending.component';
import { MasterAdminSetupGuard } from 'src/app/core/guards/master-admin-setup.guard';
import { CreateMasterAdminComponent } from '../auth/create-master-admin/create-master-admin.component';


const routes: Routes = [
  {
    path: '',
    component: WrapperComponent, canActivate: [MasterAdminSetupGuard],
    children: [
      { path: '', redirectTo: 'step1', pathMatch: 'full' },
      { path: 'step1', component: AccountSetupComponent },
      { path: 'step2', component: BusinessSetupComponent },
      { path: 'step3', component: PreferencesComponent },
      { path: 'step4', component: ReviewAndSubmitComponent },
    ],
  },
  { path: 'create-Master-Admin', component: CreateMasterAdminComponent },
  { path: 'verification-pending', component: VerificationPendingComponent },
  { path: 'activation/:token', component: ActivationComponent },
  { path: '**', redirectTo: '', pathMatch: 'full' }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class InitialConfigRoutingModule { }
